import React from "react";
import MobileNavBar from "../Header/MobileNavBar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Footer = () => (
  <>

  <MobileNavBar/>
  <footer className="not-fancy-font fixed bottom-20 left-0 right-0 flex justify-center text-white ">
    <div>
      <a href="https://zenhabits.net/uncopyright/" target="_">
        <FontAwesomeIcon icon={["fab", "github"]} className="text-30" />
      </a>
    </div>
  </footer>
  </>
);

export default Footer;
